import React from "react";

const Footer = () => {
  return (
    <footer>
      <div className="footer-container">
        {" "}
        <p>Projet réalisé par Coralie Rubin</p>
        <p>
          Les icônes Wolverine, Iron-man, Spider-man, Batman sont prises sur
          iconFinder.com
        </p>
      </div>
    </footer>
  );
};

export default Footer;
